import React from 'react';
import {Box, Button, Center, Input, Stack} from "@chakra-ui/react";

const Home = () => {
    return (
        <Box bg={'#F7FAFC'} minHeight={'100vh'}>

            <Box p={4} maxW={'400px'} minH={'200px'}>
                <Stack align={'center'} alignItems={'center'} bg={'white'} direction={'row'} minH={'200px'} maxW={'400px'} alignSelf={'center'}>
                  <Center>
                      <Input placeholder={'Enter a join code'}/>
                      <Button>Join</Button>
                  </Center>
                </Stack>
            </Box>
        </Box>
    );
};

export default Home;
